import React from 'react';
import logo from './logo.svg';
import './App.css';
import jsPDF from 'jspdf';

class App extends React.Component {

  myData = () => {
    var doc = new jsPDF({
      orientation: 'landscape',
      unit: 'in',
      format: [4, 2]
    })

    doc.text('Hello world!', 1, 1)
    doc.save('two-by-four.pdf')
  }
  render() {
    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
